texto_tramitacao:
Juntados:
1 - Tramitação da matéria na comissão mista (fls. 183 a 187, cópias das páginas correspondentes no portal do Congresso Nacional);
2 - Composição atual da comissão mista (fls. 188 e 189, cópias do portal das comissões); 
3 - Os seguintes ofícios de indicação ou substituição de membros da comissão (fls. 190 a 207):
- n° 225/2019 da Liderança do MDB/SF (fl. 190);
- n° 307/2019 da Liderança do PSB/CD (fl. 191);
- n° 375/2019 da Liderança do PL/CD (fl. 192);
- n° 74/2019 da Liderança do PP/SF (fl. 193);
- n° 80/2019 da Liderança do AVANTE/CD (fl. 194);
- n° 117/2019 da Liderança do PODEMOS/SF (fl. 195);
- n° 212/2019 da Liderança do REPUBLICANOS/CD (fl. 196);
- n° 372/2019 da Liderança do Bloco PP,MDB,PTB (fl. 197);
- n° 120/2019 da Liderança do PSDB/SF (fl. 198);
- n° 105/2019 da Liderança do Bloco Parlamentar da Resistência Democrática (fl. 199);
- n° 383/2019 da Liderança do Bloco PP,MDB,PTB (fl. 200);
- n° 380/2019 da Liderança do Bloco PP,MDB,PTB (fl. 201);
- n° 645/2019 da Liderança do PT/CD (fl. 202);
- n° 599/2019 da Liderança do PSDB/CD (fl. 203);
- n° 274/2019 da Liderança do PODEMOS/CD (fl. 204);
- n° 485/2019 da Liderança do PSL/CD (fl. 205);
- n° 396/2019 da Liderança do Bloco PP,MDB,PTB (fl. 206);
- n° 488/2019 da Liderança do PSL/CD (fl. 207); e
4 - Publicação, no DOU de 10/12/2019 (pág. 1), do Ato do Presidente da Mesa do Congresso Nacional nº 72, de 2019, que fez saber que a presente medida provisória teve sua vigência prorrogada pelo prazo de sessenta dias, nos termos do § 7º do art. 62 da Constituição Federal (fl. 208).
